import MyDateRang from './MyDateRang'
import InputRange from './InputRange'
import MyYearMonth from './MyYearMonth'
import OrgSelect from './OrgSelect'
import TreeSelect from './TreeSelect'
import CapitalSelect from './CapitalSelect'
// import PersonSelect from './PersonSelect'
import PersonSelect2 from './PersonSelect2'
import Select from './Select'
export default {
  components: { InputRange, TreeSelect, OrgSelect, CapitalSelect, Select, MyDateRang, PersonSelect2, MyYearMonth },
  model: { event: 'change', prop: 'value' },
  props: {
    valueFormat: {
      type: String,
      default: 'yyyy-MM-dd HH:mm:ss'
    },
    component: {
      type: String,
      default: ''
    },
    width: {
      type: String,
      default: '300px'
    },
    size: {
      type: String,
      default: 'small'
    },
    checkStrictly: {
      type: Boolean,
      default: false
    },
    placeholder: {
      type: String,
      default: '请输入'
    },
    multiple: {
      type: Boolean,
      default: false
    },
    dateType: {
      type: String,
      default: 'daterange'
    },
    options: {
      type: Array,
      default() {
        return []
      }
    },
    value: {
      type: [Array, String, Number, Object, Date],
      default: ''
    }
  },
  computed: {
    inputVal: {
      set: function(val) {
        // console.log('期间设置', val[0], val[1])
        // if (this.component === 'DatePicker') {
