        //     })
        //   } else {
        //     val = val instanceof Date ? this.utils.parseTime(val) : val
        //   }
        // }

        this.$emit('change', val)
      },
      get: function() {
        // console.log('获取', this.value)
        return this.value
      }
    }
  }

}
